import React from 'react';
import logos from './assets/logos/index';
import styled from 'styled-components';

const MaintenanceLayout = styled.div`
    width: 80%;
    height: 100%;
    display: flex;
    justify-content: space-between;
    align-items: center;
    flex-wrap: wrap;
`
const MaintenanceMessage = styled.div`
    width: 40%;
    height: 100%;
    display: flex;
    justify-content: center;
    align-items: center;
    flex-direction: column;
`
const MessageTitle = styled.div`
    font-size: 5vw;
    margin-bottom: 5%;
`;

const MessageSubtitle = styled.span`
    font-size: 2vw;
    text-align: right;
`;

const MessageBody = styled.div`
    font-size: 1vw;
`;


const MaintenanceImage = styled.img`
    width: 60%;
    object-fit: contain;
`

const Maintenance = () => {
    return (
        <MaintenanceLayout >
            <MaintenanceMessage>
                <MessageTitle>{'workharder.io'}</MessageTitle>
                <MessageSubtitle>{"A more functional site in the process"}</MessageSubtitle>
                <MessageSubtitle>{``}</MessageSubtitle>
                <MessageBody>As I"m working toward building a new site</MessageBody>
            </MaintenanceMessage>
            <MaintenanceImage src={logos[Math.floor(Math.random() * logos.length)]} />
        </MaintenanceLayout>

    );
}

export default Maintenance;
